(489, 'es', 'home', 'home_cont1', '<h1 style=\\"text-align: center;margin-bottom: 30px;font-size: 19px;\\">Bienvenido a Seo Panel - Mundial\r\nprimero seo panel de control para varios sitios Web</h1>\r\n        <p>\r\n            Un completo <b>open source seo panel de control</b> para la gestin de <b>optimizacin del buscadores</b> de\r\nsus sitios web.\r\n            Seo Panel es una <b>seo kit de herramientas</b> incluye las ltimas herramientas seo caliente <b>aumentar y hacer un seguimiento</b> el\r\n<b> Rendimiento </b> de sus sitios web.\r\n            Se trata de un <b>free software</b> publicado bajo <b>GNU GENERAL PUBLIC LICENSE</b>.\r\n            La caracterstica principal de seo panel es su <b>posibilidad de ampliacin</b> mediante el uso de<a href=\\"<?=SP_PLUGINSITE?>\\"\r\ntarget=\\"_blank\\">seo plugins</a>.\r\n            Cualquiera puede fcilmente <b>desarrollar e instalar</b> plugins necesarios para su panel de seo. \r\n        </p>\r\n        <p></p>\r\n        <p>Este software de cdigo abierto <b>fue lanzado en enero de 2010</b>\r\n          \r\n           Dentro de este <b>corto perodo</b> de tiempo <b>miles</b> de <b>web masters</b> est usando este\r\nsoftware para<b>la optimizacin de</b> sus sitios web.\r\n            Utilice el panel seo hoy mismo y <b>disfrutar</b> todo lo relacionado con SEO en virtud de un <b>solo\r\nplataforma</b>.\r\n        </p>', '2010-09-23 02:09:08'),
(490, 'es', 'home', 'home_cont2', '<fieldset>\r\n<legend>Caractersticas principales de Seo Panel <?=SP_INSTALLED?></legend>\r\n<ul class=\\"infobox\\">\r\n    <li>        \r\n        <h1>Directorio automtica sumisin herramienta</h1>\r\n        <p>\r\n            Directorio automtica sumisin herramienta nos ayudar a<b>aadir nuestros sitios</b>en los principales <b>gratuitos y de pago directorios del Internet</b>.\r\n            Tambin puede <b>el seguimiento del estado</b> envio a travs de cada <b>verificacin peridica</b> mediante el uso de\r\nsumisin <b>estado de script verificador</b>.\r\n            <b>Directorio manager</b> nos ayudar a averiguar si <b>el directorio est activo</b> o no.\r\n        </p>\r\n    </li>\r\n    <li>        \r\n        <h1>Palabra clave Posicin Verificador</h1>\r\n        <p>\r\n           Palabra clave Posicin Verificador se encuentra el <b>posicin del motor de bsqueda</b> de <b>palabras clave orientadas</b>\r\nde su sitio web y <b>almacena</b> en el sistema.\r\n           En la seccin de palabras clave los informes de posicin, podemos ver el <b>posiciones diarias</b> de palabras clave en\r\ndiferentes motores de bsqueda por <b>grficos hermosos</b> y <b>informes detallados</b>.\r\n        </p>\r\n    </li>\r\n    <li>        \r\n        <h1>Generador mapa de sitio</h1>\r\n        <p>Esto nos ayudar a crear <b>XML,HTML,TEXT</b> mapa del sitio archivos de nuestro sitio web para <b>sumision</b>\r\na los motores de bsqueda.</p>\r\n    </li>\r\n    <li>        \r\n        <h1>Google y Alexa Rank Verificador</h1>\r\n        <p>\r\n            Google y Alexa Rank Verificador se encuentra <b>google pagerank</b> y <b>alexa rank</b> de nuestros\r\nsitios web y <b>almacena</b> en el sistema.\r\n            En <b>rango de informes</b> seccin, podemos ver el<b>diario</b> google and alexa rank of each website\r\npor <b>informes detallados</b>.\r\n        </p>\r\n    </li>\r\n    <li>        \r\n        <h1>Vnculos de retroceso Verificador</h1>\r\n        <p>\r\n            Vnculos de retroceso Verificador se encuentra <b>number of backlinks</b> de nuestros sitios web en busca diferentes\r\nmotores<b>(google,yahoo,msn etc)</b> y <b>almacena</b> en el sistema.\r\n            <br>En <b>informes backlink</b> seccin, podemos ver el <b>backlinks diaria contar</b> de cada\r\nsitio web<b>informes detallados</b>.\r\n        </p>\r\n    </li>    \r\n    <li>        \r\n        <h1>Motor de bsqueda Saturacin Verificador</h1>\r\n        <p>\r\n          Motor de bsqueda Saturacin Verificador se encuentra <b>nmero de pginas indexadas</b> de nuestros sitios web en\r\ndiferentes motores de bsqueda<b>(google,yahoo,msn etc)</b> y <b>almacena</b> en el sistema.\r\n            En <b>Motor de bsqueda Saturacin Verificador</b> seccion, podemos ver la <b>indexados al da la pgina\r\ncontar</b> de cada sitio web por <b>informes detallados</b>.\r\n        </p>\r\n    </li>\r\n    <li>        \r\n        <h1>Seo Panel Plugins</h1>\r\n        <p>\r\n            La <b>principal caracterstica</b> de seo panel de control es su<b>extensibilidad</b>.\r\n            Aadir <b> plugins SEO </b> para su seo panel por <b>ampliar las funciones</b> de acuerdo a sus\r\nrequisito.\r\n            <a href=\\"<?=SP_PLUGINSITE?>\\" target=\\"_blank\\">Seo panel plugins</a> son proporcionados por el panel seo\r\ny sitios de terceros.\r\n            Tambin puede fcilmente <b>desarrollar</b> plugins SEO para su panel de seo.\r\n            Usted puede <a href=\\"<?=SP_PLUGINSITE?>\\" target=\\"_blank\\">almacena</a> su plugin seo seo de panel y\r\nnos <b> publicar </b> en nuestro sitio web despus de nuestra  <b>  proceso de revisar </b>\r\n        </p>\r\n    </li>\r\n    <li>        \r\n        <h1>Meta Tag Generador</h1>\r\n        <p>\r\n            Meta tag generador es un <b>seo panel plugin</b> para la creacin de <b> etiquetas personalizadas meta </b> para nuestros\r\nsitio.\r\n          \r\nNos ayudar a dar <b>Ms informacin </b> sobre el sitio a contra <b>los robots de los motores de bsqueda </b>\r\nmientras se arrastran nuestro sitio web.\r\n        </p>\r\n    </li>\r\n</ul>\r\n</fieldset>', '2010-09-23 02:09:08'),
(491, 'es', 'home', 'home_cont3', '<fieldset>\r\n<legend>Seo Panel Recursos en linea</legend>    \r\n<ul class=\\"infobox\\">\r\n\r\n    <li>\r\n        <h1>Seo Panel Recursos en linea de Referencia</h1>                \r\n        \r\n        \r\n        <p>\r\n            <a href=\\"http://www.seopanel.in\\" target=\\"_blank\\">Seo Panel Sitio Oficial</a>\r\n        </p>\r\n        <p>\r\n            <a href=\\"<?=SP_DOWNLOAD_LINK?>\\" target=\\"_blank\\">Descarga Seo Panel</a>\r\n        </p>\r\n        \r\n        <p>\r\n            <a href=\\"<?=SP_DEMO_LINK?>\\" target=\\"_blank\\">Seo Panel Demo</a>\r\n        </p>\r\n        \r\n        <p>\r\n            <a href=\\"<?=SP_CONTACT_LINK?>\\" target=\\"_blank\\">Contacto Seo Panel</a>\r\n        </p>\r\n        \r\n        <p>\r\n            <a href=\\"<?=SP_HELP_LINK?>\\" target=\\"_blank\\">Seo Panel Gua de Ayuda</a>\r\n        </p>\r\n        \r\n        <p>\r\n            <a href=\\"<?=SP_FORUM_LINK?>\\" target=\\"_blank\\">Seo Panel Foro</a>\r\n        </p>\r\n        \r\n        <p>\r\n            <a href=\\"<?=SP_SUPPORT_LINK?>\\" target=\\"_blank\\">Seo Panel Soporte Sistema</a>\r\n        </p>\r\n        \r\n        <p>\r\n            <a href=\\"<?=SP_DONATE_LINK?>\\" target=\\"_blank\\">Haz una donacin a Seo Panel</a>\r\n        </p>\r\n    </li>\r\n    \r\n</ul>\r\n</fieldset>', '2010-09-23 02:09:08'),
