(789, 'fr', 'support', 'support_cont1', '<fieldset>\r\n<legend>Support Seo Panel</legend>\r\n<ul class=\\"infobox\\">\r\n    <li>\r\n        <h1>Pack de 1000 annuaires</h1> \r\n        <p>\r\n            Nous pouvons vous fournir un pack de <b>1000 annuaires gratuits, actifs et vrifis</b>,  ajouter  votre Seo Panel.\r\n            Cela vous aidera  <b>augmenter les liens retour</b> vers vos sites.<br/>\r\n            Ce pack a t cr pour <b>financer les prochains dvelopements</b> de Seo Panel.<br/>\r\n            Pour obtenir le pack, merci de <a href=\\"<?=SP_DONATE_LINK?>\\" target=\\"_blank\\">donner</a> 10$ ou plus, pour aider  amliorer Seo Panel.<br>\r\n            Si vous avez des questions sur ce pack de 1000 annuaires, n\\''hsitez pas  <a href=\\"<?=SP_CONTACT_LINK?>\\" target=\\"_blank\\">nous contacter</a> ou  <a href=\\"<?=SP_SUPPORT_LINK?>\\" target=\\"_blank\\">ouvrir un ticket</a>.\r\n        </p>        \r\n        <p>\r\n            <a href=\\"<?=SP_DONATE_LINK?>\\" target=\\"_blank\\">Cliquer ici pour aider  financer Seo Panel.</a>\r\n        </p>\r\n        <br>\r\n    </li>\r\n    \r\n    <li>\r\n        <h1>Pack de moteurs de recherche locaux</h1> \r\n        <p>\r\n            Ajoutez les moteurs de recherche locaux de Google, Yahoo, MSN (<b>ex: www.google.fr, www.yahoo.fr, ...</b>) au <b>contrle de position sur mot-cl</b>, pour suivre le rfrencement local de vos sites.<br/>\r\n            Pour obtenir le pack de moteurs de recherche locaux (en fonction de vos besoins), merci de <a href=\\"<?=SP_DONATE_LINK?>\\" target=\\"_blank\\">donner</a> 10$ ou plus pour aider  amliorer Seo Panel.<br/>\r\n            Avant de faire le don, merci de <a href=\\"<?=SP_CONTACT_LINK?>\\" target=\\"_blank\\">nous contacter</a> afin de nous communiquer la liste des moteurs de recherche souhaits.<br><br>\r\n            Si vous souhaitez ajouter de <b>nouveaux moteurs de recherches</b>  votre suivi de position sur mot-cl Seo Panel, merci de <a href=\\"<?=SP_CONTACT_LINK?>\\" target=\\"_blank\\">nous contacter</a> ou d\\''<a href=\\"<?=SP_SUPPORT_LINK?>\\" target=\\"_blank\\">ouvrir un ticket</a>.\r\n        </p>        \r\n        <p class=\\"visit\\">\r\n            <a href=\\"<?=SP_CONTACT_LINK?>\\" target=\\"_blank\\">Cliquer ici pour nous contacter.</a>\r\n        </p>\r\n        <br>\r\n    </li>\r\n    \r\n    <li>\r\n        <h1>Plugins Seo Panel</h1> \r\n        <p>\r\n           Ajouter des <b>plugins</b>  votre Seo Panel, afin d\\''ajouter de <b>nouvelles fonctionnalits</b>, selon vos besoins.<br/>\r\n           Les <a href=\\"<?=SP_PLUGINSITE?>\\" target=\\"_blank\\">plugins Seo Panel</a> sont disponibles via Seo Panel, ou des tiers.<br/>\r\n           Vous pouvez facilement <b>dvelopper</b> des plugins pour votre Seo Panel, et <a href=\\"<?=SP_PLUGINSITE?>\\" target=\\"_blank\\">soumettre vos plugins</a> sur le site Seo Panel, o ils seront publis aprs <b>validation</b>. \r\n        </p>        \r\n        <p>\r\n            <a href=\\"<?=SP_PLUGINSITE?>\\" target=\\"_blank\\">Cliquer ici pour obtenir les plugins disponibles.</a>\r\n        </p>\r\n        <br>\r\n    </li>    \r\n    <li>\r\n        <h1>Nous contacter</h1> \r\n        <p>\r\n            N\\''hsitez pas  nous contacter  propos des <b>outils, plugins et fonctionnalits de Seo Panel</b> en utilisant le lien ci-dessous.\r\n        </p>        \r\n        <p>\r\n            <a href=\\"<?=SP_CONTACT_LINK?>\\" target=\\"_blank\\">Cliquer ici pour nous contacter.</a>\r\n        </p>\r\n        <br>\r\n    </li>    \r\n    <li>\r\n        <h1>Tickets de Support</h1> \r\n        <p>\r\n            Pour obtenir un <b>support technique</b> de l\\''quipe Seo Panel sur l\\''<b>installation de Seo Panel, des outils ou des plugins</b>. Ex.: Configurer l\\''excution priodique (cron) du contrle de position sur mot-cl, rsoudre un dysfonctionnement post-installation, ...\r\n        </p>        \r\n        <p>\r\n            <a href=\\"<?=SP_SUPPORT_LINK?>\\" target=\\"_blank\\">Cliquer ici pour ouvrir un ticket de support technique.</a>\r\n        </p>\r\n        <br>\r\n    </li>    \r\n    <li>\r\n        <h1>Signaler un bug</h1> \r\n        <p>\r\n            Signalez les <b>bugs</b> de <b>Seo Panel, des outils ou des plugins</b> en utilisant le lien ci-dessous.<br/>\r\n            Cela nous aidera  amliorer les prochaines versions.\r\n        </p>        \r\n        <p>\r\n            <a href=\\"<?=SP_SUPPORT_LINK?>\\" target=\\"_blank\\">Cliquer ici pour signaler un bug.</a>\r\n        </p>\r\n        <br>\r\n    </li>    \r\n</ul>\r\n</fieldset>', '2010-09-28 03:36:44'),
(790, 'fr', 'support', 'support_cont2', '<fieldset>\r\n<legend>Seo Panel - Ressources en ligne</legend>\r\n<ul class=\\"infobox\\">\r\n        \r\n    <li>\r\n        <h1>L\\''aide Seo Panel</h1> \r\n        <p>\r\n            Vous pouvez consulter la <a href=\\"<?=SP_HELP_LINK?>\\" target=\\"_blank\\">documentation</a> pour Seo Panel, ses fonctionnalits, ainsi que les outils et plugins.\r\n            <br>C\\''est le meilleur endroit pour <b>avoir de l\\''aide</b> sur Seo Panel. Nous esprons que vous pourrez <b>contribuer</b> au guide Seo Panel, si vous trouvez des erreurs ou des choses qui manquent.\r\n        </p>\r\n        <p>\r\n            <a href=\\"<?=SP_HELP_LINK?>\\" target=\\"_blank\\">Cliquer ici pour voir l\\''aide Seo Panel.</a>\r\n        </p>\r\n        <br>\r\n    </li>    \r\n    <li>\r\n        <h1>Le forum Seo Panel</h1> \r\n        <p>\r\n            Un endroit o discuter du <b>premier panneau de contrle Seo en open source au monde</b>.<br>C\\''est le meilleur endroit pour trouver des <b>rponses</b>  <b>vos questions</b>  propos de Seo Panel.<br>Vous pouvez aussi y <b>partager vos expriences</b> afin d\\''optimiser le rfrencement de vos sites internet.\r\n        </p>        \r\n        <p>\r\n            <a href=\\"<?=SP_FORUM_LINK?>\\" target=\\"_blank\\">Cliquer ici pour aller sur le forum Seo Panel</a>\r\n        </p>\r\n        <br>\r\n    </li>\r\n</ul>    \r\n</fieldset>', '2010-09-28 03:36:44'),
(791, 'fr', 'support', 'support_cont3', '<fieldset>\r\n<legend>Dons pour Seo Panel</legend>\r\n<ul class=\\"infobox\\">        \r\n    <li>\r\n        <h1>Donnez pour Seo Panel - Le premier panneau de contr&ocirc;le open source Seo au monde</h1> \r\n        <p>\r\n            <b>Donnez</b> &agrave; Seo Panel pour financer le premier panneau de contr&ocirc;le open source Seo au monde.<br/>\r\n            Nous pr&eacute;voyons bien sur des <b>ajouts et am&eacute;liorations</b> des fonctionnalit&eacute;s de Seo Panel, et gr&acirc;ce &agrave; votre support, nous pourrons atteindre les <b>buts fix&eacute;s</b>.\r\n            Si <b>vous appr&eacute;ciez Seo Panel</b>, merci de <b>faire un don</b> &agrave; l\\''&eacute;quipe Seo Panel afin d\\''aider &agrave; financer son d&eacute;veloppement.<br/>\r\n            D&egrave;s r&eacute;ception de votre don, nous publierons, avec votre accord, votre nom et votre site sur la <a href=\\"<?=SP_DONATE_LINK?>\\" target=\\"_blank\\">page de dons</a>.\r\n            \r\n            \r\n        </p>\r\n        <p>\r\n            <a href=\\"<?=SP_DONATE_LINK?>\\" target=\\"_blank\\">Cliquer ici pour faire un don</a>\r\n        </p>\r\n        <br>\r\n    </li>\r\n</ul>\r\n</fieldset>', '2010-09-28 03:36:44'),
