(1046, 'de', 'support', 'support_cont1', '<fieldset>\r\n<legend>Seo Panel Support System</legend>\r\n<ul class=\\"infobox\\">\r\n	<li>\r\n		<h1>1000-Webkataloge-Paket</h1> \r\n		<p>\r\n			Wir bieten dir ein Paket mit <b>1000 kostenlosen, aktiven und verifizierten</b> Webkatalogen, zur Integration in das <b>Verzeichnis Eintragungs Tool</b>.\r\n			Dieses hilft dir die Anzahl an <b>Backlinks</b> deiner eigenen Webseiten <b>erheblich zu steigern</b>.\r\n			Wir stellen diese Liste momentan zur Verfuegung um Geld zu sammeln fuer <b>zukuenftige Entwicklungen</b> fuer SEO Panel.\r\n			Um die Liste zu erhalten, <a href=\\"<?=SP_DONATE_LINK?>\\" target=\\"_blank\\">spende</a> $10 oder mehr um SEO Panel zu verbessern.\r\n			Falls du Fragen hast, nimm bitte <a href=\\"<?=SP_CONTACT_LINK?>\\" target=\\"_blank\\">Kontakt</a> auf oder oeffne ein Ticket im <a href=\\"<?=SP_SUPPORT_LINK?>\\" target=\\"_blank\\">Support System</a>.   \r\n		</p>		\r\n		<p>\r\n			<a href=\\"<?=SP_DONATE_LINK?>\\" target=\\"_blank\\">Hier klicken um eine Spende abzugeben.</a>\r\n		</p>\r\n		<br>\r\n	</li>\r\n	\r\n	<li>\r\n		<h1>Das Lokale-Suchmaschinen-Paket</h1> \r\n		<p>\r\n			Fuege <b>lokale Suchmaschinendomains</b> fuer google,yahoo,msn(<b>z.B: www.google.de,www.google.fr etc</b>) zum Seo Panel <b>Keyword Ranking Checker</b> hinzu, um das Ranking lokal zu analysieren.\r\n			Um lokale Suchmaschinen-Pakete zu erhalten, bitte <a href=\\"<?=SP_DONATE_LINK?>\\" target=\\"_blank\\">spende</a> $10 oder mehr um SEO Panel zu verbessern.\r\n			Bevor du spendest, nimm bitte <a href=\\"<?=SP_CONTACT_LINK?>\\" target=\\"_blank\\">Kontakt</a> auf und nenne uns die benoetigten Suchmaschinen Laenderkennzeichnungen.\r\n			<br><br>			  \r\n			Um <b>neue Suchmaschinen(z.B.:baidu.com)</b> hinzuzufuegen, nimm bitte <a href=\\"<?=SP_CONTACT_LINK?>\\" target=\\"_blank\\">Kontakt</a> auf oder oeffne ein Ticket im <a href=\\"<?=SP_SUPPORT_LINK?>\\" target=\\"_blank\\">Support System</a>. \r\n		</p>		\r\n		<p class=\\"visit\\">\r\n			<a href=\\"<?=SP_CONTACT_LINK?>\\" target=\\"_blank\\">Hier klicken um Kontakt aufzunehmen.</a>\r\n		</p>\r\n		<br>\r\n	</li>\r\n	\r\n	<li>\r\n		<h1>Seo Panel Erweiterungen</h1> \r\n		<p>\r\n			Integriere <b>SEO Erweiterungen</b> in Seo Panel, um die <b>Features zu erweiteren</b> um Sie deinen Anforderungen anzupassen.\r\n			<a href=\\"<?=SP_PLUGINSITE?>\\" target=\\"_blank\\">Seo Panel Erweiterungen</a> sind erhaeltlich von Seo Panel und Drittanbietern.\r\n			Es ist auch leicht, selbst Erweiterungen fuer Seo Panel zu <b>entwickeln</b>.\r\n			Du kannst deine eigene Erweiterung <a href=\\"<?=SP_PLUGINSITE?>\\" target=\\"_blank\\">uebermitteln</a> und wir werden es auf der webseite <b>veroeffentlichen</b>.        \r\n		</p>		\r\n		<p>\r\n			<a href=\\"<?=SP_PLUGINSITE?>\\" target=\\"_blank\\">Hier klicken fuer Seo Panel Erweiterungen</a>\r\n		</p>\r\n		<br>\r\n	</li>	\r\n	<li>\r\n		<h1>Kontakt</h1> \r\n		<p>\r\n			Nimm mit uns Kontakt auf, wenn Fragen zu <b>Seo Panel Tools, Erweiterungen, etc..</b> bestehen.       \r\n		</p>		\r\n		<p>\r\n			<a href=\\"<?=SP_CONTACT_LINK?>\\" target=\\"_blank\\">Hier klicken um Kontakt aufzunehmen.</a>\r\n		</p>\r\n		<br>\r\n	</li>	\r\n	<li>\r\n		<h1>Support Tickets</h1> \r\n		<p>\r\n			Fuer <b>technischen Support</b> vom Seo Panel Team.\r\n		</p>		\r\n		<p>\r\n			<a href=\\"<?=SP_SUPPORT_LINK?>\\" target=\\"_blank\\">Hier klicken um ein Support Ticken zu oeffnen.</a>\r\n		</p>\r\n		<br>\r\n	</li>	\r\n	<li>\r\n		<h1>Fehler berichten.</h1> \r\n		<p>\r\n			Berichte uns von <b>Fehlern</b> ueber <b>Seo panel Tools, Erweiterungen, etc. </b> durch klick auf diesen Link. \r\n			Bitte unterstuetze uns, Seo Panel in der Zukunft zu verbessern.          \r\n		</p>		\r\n		<p>\r\n			<a href=\\"<?=SP_SUPPORT_LINK?>\\" target=\\"_blank\\">Hier klicken um Fehler zu berichten.</a>\r\n		</p>\r\n		<br>\r\n	</li>	\r\n</ul>\r\n</fieldset>\r\n\r\n\r\n<fieldset>\r\n<legend>Seo Panel Online Ressourcen</legend>\r\n<ul class=\\"infobox\\">\r\n		\r\n	<li>\r\n		<h1>Seo Panel Hilfe</h1> \r\n		<p>\r\n			Schau dir die <a href=\\"<?=SP_HELP_LINK?>\\" target=\\"_blank\\">Seo Panel Dokumentation</a> in der <b>Hilfestellung</b> an. Diese beinhaltet die <b>Dokumentation</b> ueber Seo Panel Tools, Erweiterungen und vieles mehr.\r\n			<br>Dies ist der beste Platz im Internet um <b>Hilfe</b> fuer Seo Panel zu erhalten. Wir bitten darum im SEO Panel \\"help guide\\" darueber zu <b>berichten</b> falls Fehler entdeckt werden. 	          \r\n		</p>\r\n		<p>\r\n			<a href=\\"<?=SP_HELP_LINK?>\\" target=\\"_blank\\">Hier klicken um zum Hilfe-Bereich zu gelangen.</a>\r\n		</p>\r\n		<br>\r\n	</li>	\r\n	<li>\r\n		<h1>Seo Panel Forum</h1> \r\n		<p>\r\n			Der Platz um ueber das weltweit erste Open Source <b>Seo Control Panel</b> zu diskutieren. \r\n			Der beste Platz um <b>Antworten</b> auf <b>deine Fragen</b> ueber Seo Panel zu finden.\r\n			<br>Hier koennen auch <b>Erfahrungen ausgetauscht werden</b>.		     	          \r\n		</p>		\r\n		<p>\r\n			<a href=\\"<?=SP_FORUM_LINK?>\\" target=\\"_blank\\">Hier klicken um zum Seo Panel Forum zu gelangen.</a>\r\n		</p>\r\n		<br>\r\n	</li>\r\n</ul>	\r\n</fieldset>\r\n\r\n\r\n<fieldset>\r\n<legend>Spenden fuer Seo Panel</legend>\r\n<ul class=\\"infobox\\">		\r\n	<li>\r\n		<h1>Gib eine Spende fuer Seo Panel ab - Das erste Open Source Seo Control Panel weltweit.</h1> \r\n		<p>\r\n			<b>Spende</b> an Seo Panel um die weltweit erste Open Source SEO Software zu unterstuetzen.\r\n			Es ist geplant in der Zukunft weitere Features <b>hinzuzufgen und zu verbessern</b> . \r\n			<br>Nur mit dem <b>Support</b> unserer Benutzer ist es moeglich unsere <b>Ziele</b> zu erreichen.\r\n			Bist du der Meinung, Seo Panel ist <b>nuetzlich</b> fuer dich, gib bitte eine kleine Spende ab.\r\n			<br>Wir werden deinen Namen und deine Webseite auf unserer <a href=\\"<?=SP_DONATE_LINK?>\\" target=\\"_blank\\">Spendenseite</a> <b>veroeffentlichen</b> \r\n		</p>\r\n		<p>\r\n			<a href=\\"<?=SP_DONATE_LINK?>\\" target=\\"_blank\\">Hier klicken um fuer Seo Panel zu spenden</a>\r\n		</p>\r\n		<br>\r\n	</li>\r\n</ul>\r\n</fieldset>', '2010-09-29 23:25:32'),
(1047, 'de', 'support', 'support_cont2', '<fieldset>\r\n<legend>Seo Panel Online Ressourcen</legend>\r\n<ul class=\\"infobox\\">\r\n		\r\n	<li>\r\n		<h1>Seo Panel Hilfe</h1> \r\n		<p>\r\n			Schau dir die <a href=\\"<?=SP_HELP_LINK?>\\" target=\\"_blank\\">Seo Panel Dokumentation</a> in der <b>Hilfestellung</b> an. Diese beinhaltet die <b>Dokumentation</b> ueber Seo Panel Tools, Erweiterungen und vieles mehr.\r\n			<br>Dies ist der beste Platz im Internet um <b>Hilfe</b> fuer Seo Panel zu erhalten. Wir bitten darum im SEO Panel \\"help guide\\" darueber zu <b>berichten</b> falls Fehler entdeckt werden. 	          \r\n		</p>\r\n		<p>\r\n			<a href=\\"<?=SP_HELP_LINK?>\\" target=\\"_blank\\">Hier klicken um zum Hilfe-Bereich zu gelangen.</a>\r\n		</p>\r\n		<br>\r\n	</li>	\r\n	<li>\r\n		<h1>Seo Panel Forum</h1> \r\n		<p>\r\n			Der Platz um ueber das weltweit erste Open Source <b>Seo Control Panel</b> zu diskutieren. \r\n			Der beste Platz um <b>Antworten</b> auf <b>deine Fragen</b> ueber Seo Panel zu finden.\r\n			<br>Hier koennen auch <b>Erfahrungen ausgetauscht werden</b>.		     	          \r\n		</p>		\r\n		<p>\r\n			<a href=\\"<?=SP_FORUM_LINK?>\\" target=\\"_blank\\">Hier klicken um zum Seo Panel Forum zu gelangen.</a>\r\n		</p>\r\n		<br>\r\n	</li>\r\n</ul>	\r\n</fieldset>', '2010-09-29 23:25:32'),
(1048, 'de', 'support', 'support_cont3', '<fieldset>\r\n<legend>Fuer SEO Panel spenden</legend>\r\n<ul class=\\"infobox\\">		\r\n	<li>\r\n		<h1>Spende fuer die zukuenftige SEO Panel Entwicklung - Das erste Open Source Seo Control Panel weltweit.</h1> \r\n		<p>\r\n			<b>Spende</b> an Seo Panel um die weltweit erste Open Source SEO Software zu unterstuetzen.\r\n			Es ist geplant in der Zukunft weitere Features <b>hinzuzufgen und zu verbessern</b> . \r\n			<br>Nur mit dem <b>Support</b> unserer Benutzer ist es moeglich unsere <b>Ziele</b> zu erreichen.\r\n			Bist du der Meinung, Seo Panel ist <b>nuetzlich</b> fuer dich, gib bitte eine kleine Spende ab.\r\n			<br>Wir werden deinen Namen und deine Webseite auf unserer <a href=\\"<?=SP_DONATE_LINK?>\\" target=\\"_blank\\">Spendenseite</a> <b>veroeffentlichen</b> \r\n		</p>\r\n		<p>\r\n			<a href=\\"<?=SP_DONATE_LINK?>\\" target=\\"_blank\\">Hier klicken um fuer Seo Panel zu spenden</a>\r\n		</p>\r\n		<br>\r\n	</li>\r\n</ul>\r\n</fieldset>', '2010-09-29 23:25:32'),
